function equalsObj(a, b) {
	for(propName in a) {
		if(a.hasOwnProperty(propName) != b.hasOwnProperty(propName)) {
			return false;
		} else if(typeof a[propName] != typeof b[propName]) {
			return false;
		}
	}
	for(propName in b) {
		if(a.hasOwnProperty(propName) != b.hasOwnProperty(propName)) {
			return false;
		} else if(typeof a[propName] != typeof b[propName]) {
			return false;
		}
		if(!a.hasOwnProperty(propName)) continue;
		if(a[propName] instanceof Array && b[propName] instanceof Array) {
			if(!equalsObj(a[propName], b[propName])) return false;
		} else if(a[propName] instanceof Object && b[propName] instanceof Object) {
			if(!equalsObj(a[propName], b[propName]))
				return false;
		} else if(a[propName] != b[propName]) {
			return false;
		}
	}
	return true;
}
Array.prototype.removeAarry = function(_obj) {
	var len = this.length;
	for(var i = 0; i < len; i++) {
		if(equalsObj(this[i], _obj)) {
			this.splice(i, 1);
			return this;
		}
	}
}

