/**
 * 初始化下拉框
 * @param   url  		url 接口
 * @param   selectId    ul 的id
 * @param   config      相关配置信息
 * @param   callback    回调函数 
 * @return            
 */
DISC.util.initSelect = function(url, selectId, config, callback, inputId) {
	var _config = {
		keyField: "key",
		valueField: "name",
		keyFieCode: "code",
		selectValue: 1,
		selectFirstRecord: false,
	};
	$.extend(true, _config, config);
	$.ajax({
		url: url,
		type: "get",
		dataType: "json",
		success: function(data) {
			var data = $.ET.toObjectArr(data);
			console.log("封装data", data);
			var str = '';
			$.each(data, function(i, el) {

				str += '<li class="optionList"><span data-id="' + el[_config.keyField] + '" data-code="' + el[_config.keyFieCode] + '">' + el[_config.valueField] + '</span>'
			})

			$('#' + selectId).html(str);
			$('#' + inputId).val(data[0][_config.valueField]);
			$('#' + inputId).attr('data-code', data[0][_config.keyFieCode]);
			if(callback) {
				callback();
			}
		},
		error: function(result) {
			layer.msg(result);
		}
	})
}
/**
 * 下拉框展示和选择
 * @return {[type]} [description]
 */
DISC.util.select = function(listHeight) {
	if(listHeight == '' || listHeight == undefined || listHeight == null) {
		listHeight = '150px'
	}
	var select_list;
	$(document).on('click', '.dropDownMenu', function() {
		$('body').css({
			'overflow': 'hidden'
		});
		var _this = $(this);
		var option_box = _this.find('.menuListBox');
		var option_box_html = option_box.html();
		var option = option_box.find('.optionList');
		if(!option.length) {
			return false;
		}
		var option_arr = [];
		for(var i = 0; i < option.length; i++) {
			option_arr.push(option.html());
		}
		select_list = _this.find('input.selectInput');
		var offset = select_list.offset();
		var top = offset.top - $(window).scrollTop() + select_list.height() + 3;
		var left = offset.left;
		var width = select_list.width() + 42;
		$('body').append('<div class="dropDownMenuShadow"><div class="dropDownMenuCover" style="top:' + top + 'px;left:' + left + 'px;width:' + width + 'px"><div class="slimer">' + option_box_html + '</div></div></div>');
		customScroll({
			target: $(".slimer"),
			width: '100%',
			height: listHeight,
			tableHeight: $(".dropDownMenuCover").height()
		});
	});
	$(document).on('click', '.dropDownMenuCover .optionList', function() {
		select_list.val($(this).text());
		select_list.data('id', $(this).find('span').data('id'));
		select_list.data('code', $(this).find('span').data('code'));

	});
	$(document).on('click', '.dropDownMenuShadow', function() {
		$(this).remove();
		$('body').css({
			'overflow': 'inherit'
		});
	});
}
/**
 * 合并表格数据处理
 * */
function bootatrapTableKey(strId, strVal, data) { //----
	var index = 0,
		value = 0;
	$.each(data, function(i, val) {
		if(val[strId]) {
			if(val[strId] == index) {
				val[strVal] = parseFloat(value);
			} else {
				value = parseFloat(val[strVal]);
				index = val[strId];
			}
		}

	});
	return data;
};

function bootatrapTableData(strData, data) { //----
	var data = data;
	$.each(strData, function(index, value) {
		if(value)
			$.each(value, function(key, val) {
				if(val)
					$.each(val, function(i, v) {
						if(v)
							data = bootatrapTableKey(key, v, data);
					})
			});

	});
	return data;
};